import React from 'react'
import './login.scss'
/* antd */

import { Input } from 'antd';
import { UserOutlined } from '@ant-design/icons';

export default function Login() {
  return (
    <div className='login'>
      <div className='login-box'>
        <Input placeholder="default size" prefix={<UserOutlined />} />
        <Input placeholder="default size" prefix={<UserOutlined />} />
      </div>
    </div>
  )
}
